import "./TestResultScreen.scss";
import {Col, Row, Visible} from "react-grid-system";
import React, {useCallback, useEffect, useState} from "react";
import {ImageConfig, Misc} from "../../constants";
import {Dial} from "../../constants/ImageConfig";
import RecommendedTestCardComponent from "../../shared/components/recommended-test-cards/recommendedTestCardComponent";
import TestResultFollowCard from "../../shared/components/test-result-follow-cards/testResultFollowCard";
import TestResultGaugeMeterComponent
    from "../../shared/components/test-result-gauge-meter/TestResultGaugeMeterComponent";
import {CommonService} from "../../shared/services";
import {IAPIResponseType} from "../../shared/models/api.model";
import LoaderComponent from "../../shared/components/loader/loaderComponent";
import ButtonComponent from "../../shared/components/core/button/ButtonComponent";
import {useSelector} from "react-redux";
import {IRootReducerState} from "../../store/reducers";

export interface TestResultScreenProps {

}

const TestResultScreen = (props: TestResultScreenProps) => {

    const [testResults, setTestResults] = useState<any>()
    const [isTestResultDataLoaded, setTestResultDataLoaded] = useState<any>(false)
    const [isTestResultDataLoading, setTestResultDataLoading] = useState<any>(false);
    const [isTestResultDataFailed, setTestResultDataFailed] = useState<any>(false);
    const [disableNotify,setDisableNotify] = useState<any>(false)
    const {currentUser} = useSelector((state: IRootReducerState) => state.account);

    const getResult = useCallback(() => {
        const payload = {
            panelId: currentUser.panelId,
            sessionId: currentUser.sessionId,
            formId: currentUser?.formId,
        };
        setTestResultDataLoading(true);
        setTestResultDataLoaded(false);
        setTestResultDataFailed(false);
        CommonService._user.getTestResults(payload)
            .then((response: IAPIResponseType<any>) => {
                if (response.data?.length === 0) {
                    getResult();
                } else {
                    setTestResults(response.data)
                    CommonService._localStorage.removeItem(Misc.LOCAL_STORAGE_LOGGED_IN_USER_DATA);
                    CommonService._localStorage.removeItem(Misc.LOCAL_STORAGE_JWT_TOKEN);
                    setTestResultDataLoading(false);
                    setTestResultDataLoaded(true);
                    setTestResultDataFailed(false);
                }
            })
            .catch((error: any) => {
                setTestResultDataLoaded(false);
                setTestResultDataLoading(false);
                setTestResultDataFailed(true);
            })
    }, [currentUser]);

    useEffect(() => {
        getResult();
    }, [getResult])

    const renderFormBranding = useCallback(() => {
        return <div className="form-branding">
            <div className="form-branding-logo">
                <img src={ImageConfig.sdiLogo} alt="sdilogo"/>
            </div>
        </div>
    }, []);


    const handleNotify = useCallback(()=>{
        CommonService._alert.showToast("Thank you! You will be reminded after 15 days.","success",{position:"top-right"})
        setDisableNotify(true)
    },[])

    return (
        <div className={'test-result-screen screen'}>

            {isTestResultDataLoading && <>
                <LoaderComponent>Please wait! Your results are being processed</LoaderComponent>

            </>}
            {isTestResultDataFailed && <>
                <div className="no-data-found">Test results failed to load</div>
            </>}
            {isTestResultDataLoaded &&
            <Row className="test-result-wrapper">
                <Col sm={12} md={12} lg={6} className="test-result-recommended-test-wrapper">
                    <Visible xs sm md>
                        {renderFormBranding()}
                    </Visible>
                    <div className="test-result-container">
                        <div className="test-result-title">
                            Here is your result!
                        </div>
                        <div className="test-result-gauge-meter">
                            <TestResultGaugeMeterComponent
                                percentage={testResults?.result?.probabilityPercentage}
                                riskLabel={testResults?.result?.riskFactor}/>
                        </div>
                        <div className="test-result-helper-text">
                            Based on the shown results, we recommend that you perform the Rapid Antigen Test for
                            improved results.
                        </div>
                    </div>
                    <div className="test-result-recommended-test-container">
                        <div className="test-result-recommended-test-title">
                            Recommended Tests:
                        </div>
                        <div className="test-result-recommended-test-body">
                            <div className="test-result-recommended-list">
                                <Row>
                                    <Col sm={12} md={12} lg={6}>
                                        <RecommendedTestCardComponent
                                            tag={`${(testResults?.recommendedTest === "antigen" && testResults?.isHighlyRecommended ? "Highly " : "")}${(testResults?.recommendedTest === "antigen" ? "Recommended" : "")}`}
                                            image={ImageConfig.AntigenTestPoster}
                                            title="SDI Labs Antigen Test"
                                            description="At-Home COVID-19 Test"
                                            ctaLink={"https://sdilabsinc.com/self-testing-kit"}
                                        />
                                    </Col>

                                    <Col sm={12} md={12} lg={6}>
                                        <RecommendedTestCardComponent
                                            tag={`${(testResults?.recommendedTest === "rtpcr" && testResults?.isHighlyRecommended ? "Highly " : "")}${(testResults?.recommendedTest === "rtpcr" ? "Recommended" : "")}`}
                                            image={ImageConfig.RTPCRTestPoster}
                                            title="SDI Labs RT-PCR Test"
                                            description="At-Home COVID-19 Test"
                                            ctaLink={"https://sdilabsinc.com/product/rt-pcr-covid-19-saliva-test"}
                                        />
                                    </Col>
                                </Row>
                            </div>
                        </div>
                    </div>
                </Col>
                <Col sm={12} md={12} lg={6} className="test-result-recommended-steps-to-follow-wrapper">
                    <Visible lg xl xxl xxxl>
                        {renderFormBranding()}
                    </Visible>
                    <div className="test-result-recommended-steps-to-follow-container">
                        <div className="test-result-recommended-steps-to-follow-title">
                            You should follow:
                        </div>
                        {testResults?.result?.riskFactor === 'Low' &&
                        <div className={"test-result-recommended-notify-me-card-wrapper"}>
                            <div className={"test-result-recommended-notify-me-card-icon"}>
                                <img src={ImageConfig.InfoIcon} alt={'info'}/></div>
                            <div className={"test-result-recommended-notify-me-card-title"}>We care about your
                                well-being!
                            </div>
                            <div className={"test-result-recommended-notify-me-card-description-container"}>
                                <div className={"test-result-recommended-notify-me-card-description"}>We'll remind you
                                    after 15 days for taking another screening test. Please subscribe
                                    for the same.
                                </div>
                                <ButtonComponent
                                    fullWidth={false}
                                    size={"medium"}
                                    onClick={handleNotify}
                                    disabled={disableNotify}
                                    type={"button"}>
                                    Notify Me
                                </ButtonComponent>
                            </div>
                        </div>}
                        <div className="test-result-recommended-steps-to-follow-body">
                            <div className="test-result-recommended-steps-to-follow-list">
                                {testResults?.recommendedStepsToFollow && testResults?.recommendedStepsToFollow?.length &&
                                testResults?.recommendedStepsToFollow.map((data: any) => {
                                    return (
                                        <TestResultFollowCard icon={data.icon}
                                                              title={data.title}
                                                              key={CommonService.getUUID()}
                                                              description={data.subTitle}/>

                                    )
                                })
                                }
                            </div>
                        </div>
                    </div>
                    <div className="test-result-emergency-phone-widget-wrapper">
                        <div className="test-result-emergency-phone-widget-label">
                            Emergency <br/>
                            Helpline Number
                        </div>
                        <div>
                            <a href={`tel:${CommonService._staticData.EMERGENCY_PHONE_NUMBER}`}
                               className="test-result-emergency-phone-widget-icon-number-wrapper">
                                <div className="test-result-emergency-phone-widget-icon">
                                    <Dial/>
                                </div>
                                <div className="test-result-emergency-phone-widget-number">
                                    {CommonService._staticData.EMERGENCY_PHONE_NUMBER}
                                </div>
                            </a>
                        </div>
                    </div>
                </Col>
            </Row>
            }


        </div>
    );

};

export default TestResultScreen;
